INSERT INTO `person_overseer_history` (`id`, `user_id`, `username`, `item`, `work_test`, `age`, `book_id`, `title`, `writer`, `quiz_id`, `doq_quizid`, `bookregister_name`, `content`, `device`, `created_at`, `updated_at`) VALUES
(1, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 256, 'dq25-1', 'keiko03851k', 'アーノルド・シュワルツェネッガーは、ターミネーターという映画でデビューしたというのが正解。＃つまり1番。前半からの出題。＃', NULL, '2019-03-27 04:19:44', '2019-03-27 04:19:44'),
(2, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 341, 'dq25-2', 'keiko03851k', '出かける前に大騒＊おおさわ＊ぎするのは、#アーサーです。#１前半', NULL, '2019-03-27 04:19:44', '2019-03-27 04:19:44'),
(3, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 346, 'dq25-3', 'keiko03851k', '答えは１で、出典は＃前半から＃です。', NULL, '2019-03-27 04:19:44', '2019-03-27 04:19:44'),
(4, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 348, 'dq25-4', 'keiko03851k', '史郎が最上川のほとりで見つけたのは、＃つくし＃だった。２前', NULL, '2019-03-27 04:19:44', '2019-03-27 04:19:44'),
(5, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 352, 'dq25-5', 'keiko03851k', '健太君のお母さんは、＃俳句＊はいく＊＃を作るのが大好きでした。２前', NULL, '2019-03-27 04:19:45', '2019-03-27 04:19:45'),
(6, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 356, 'dq25-6', 'keiko03851k', '達郎がよく行くスーパーマーケットは、#ピーコックストア#である。', NULL, '2019-03-27 04:19:45', '2019-03-27 04:19:45'),
(7, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 253, 'dq25-7', 'keiko03851k', '何が正解なのか。それはだれにもわからない。ただ、本を沢山読むことは絶対に正しいことだ。我が子には読書させたくない、などという親がいるはずがない。＃答えは２である。前半から。＃', NULL, '2019-03-27 04:19:45', '2019-03-27 04:19:45'),
(8, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 254, 'dq25-8', 'keiko03851k', '1番目であろうが2番目であろうがそんなことはどちらでもいい。でも＃正解は２番で、前半から出題であることは確かだ。＃', NULL, '2019-03-27 04:19:45', '2019-03-27 04:19:45'),
(9, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 260, 'dq25-9', 'keiko03851k', '5，4，3，2，1，0　とカウントダウンが始まって、＃正解が２、中盤からの出題だ＃ということが判明した。', NULL, '2019-03-27 04:19:45', '2019-03-27 04:19:45'),
(10, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 262, 'dq25-10', 'keiko03851k', '姉は、「それがなんなの？」というのが口癖だ。すると僕は＃「答えは１で中盤。」といつも答える。＃', NULL, '2019-03-27 04:19:45', '2019-03-27 04:19:45'),
(11, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 343, 'dq25-11', 'keiko03851k', 'テーマを決めたのは、アレックスであった。２＃中盤＃', NULL, '2019-03-27 04:19:45', '2019-03-27 04:19:45'),
(12, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 347, 'dq25-12', 'keiko03851k', '「絶対＊ぜったい＊に勝＊か＊ってやる。」と宣言＊せんげん＊したのは、＃玄太だった。＃１中盤', NULL, '2019-03-27 04:19:46', '2019-03-27 04:19:46'),
(13, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 349, 'dq25-13', 'keiko03851k', 'まりちゃんはミートパイを、＃おいしそうに＃食べた。２中', NULL, '2019-03-27 04:19:46', '2019-03-27 04:19:46'),
(14, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 353, 'dq25-14', 'keiko03851k', 'ポール君のお父さんは、＃階段の一番上から落ちた＃のでした。1中', NULL, '2019-03-27 04:19:46', '2019-03-27 04:19:46'),
(15, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 354, 'dq25-15', 'keiko03851k', '「たあああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああああいへんだあ」と言ったのは、＃ジミー＃でした。２中盤', NULL, '2019-03-27 04:19:46', '2019-03-27 04:19:46'),
(16, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 251, 'dq25-16', 'keiko03851k', 'なぜなのか。＃それは、１が正解。＃それも中盤で。', NULL, '2019-03-27 04:19:46', '2019-03-27 04:19:46'),
(17, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 255, 'dq25-17', 'keiko03851k', '＃正解が１で、中盤から出題、＃とおしえてくれたのは、あっちゃんです。', NULL, '2019-03-27 04:19:46', '2019-03-27 04:19:46'),
(18, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 264, 'dq25-18', 'keiko03851k', '一、二の三、と勢いをつけて、＃答えは２、後半から、＃と叫んだ。', NULL, '2019-03-27 04:19:46', '2019-03-27 04:19:46'),
(19, 76, 'michiko06841s', 0, 7, 46, 25, '人生の見本', '中山圭子　斉藤律子', 266, NULL, 'keiko03851k', 'どのあたりからかと言えば、それは後半です。そして＃答えは２＃', NULL, '2019-03-27 04:19:46', '2019-03-27 04:19:46'),
(20, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 344, 'dq25-19', 'keiko03851k', '＃天衣無縫＊てんいむほう＊＃という言葉を思いついたのは、孝明だった。１後半', NULL, '2019-03-27 04:19:47', '2019-03-27 04:19:47'),
(21, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 350, 'dq25-20', 'keiko03851k', '大岡高校とシード権を争ったのは、＃第一高校＃である。２後半', NULL, '2019-03-27 04:19:47', '2019-03-27 04:19:47'),
(22, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 355, 'dq25-21', 'keiko03851k', '絵里は岡田さんと話したとき、＃一期一会＊いちごいちえ＊＃という言葉を思い出した。２後半', NULL, '2019-03-27 04:19:47', '2019-03-27 04:19:47'),
(23, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 250, 'dq25-22', 'keiko03851k', '大事なことは、＃２を選び、後半から出題することだ。＃', NULL, '2019-03-27 04:19:47', '2019-03-27 04:19:47'),
(24, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 257, 'dq25-23', 'keiko03851k', 'マキャヴェリズムとは何かわかりますか。はい、＃正解は２です。全体から出題です。＃', NULL, '2019-03-27 04:19:47', '2019-03-27 04:19:47'),
(25, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 258, 'dq25-24', 'keiko03851k', '＃答えは２で全体から。＃', NULL, '2019-03-27 04:19:47', '2019-03-27 04:19:47'),
(26, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 261, 'dq25-25', 'keiko03851k', 'トマ・ピケティの、「20世紀の資本」という本は読みましたか？＃正解は２で、それも全体からの出題です。＃', NULL, '2019-03-27 04:19:47', '2019-03-27 04:19:47'),
(27, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 342, 'dq25-26', 'keiko03851k', '答えは２である。そして、＃全体からの出題だ。＃', NULL, '2019-03-27 04:19:47', '2019-03-27 04:19:47'),
(28, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 259, 'dq25-27', 'keiko03851k', 'プールで泳ぐのと海で泳ぐのではどちらが好きか、と聞いたら、＃１で本文に無い内容＃という答えが返ってきた。', NULL, '2019-03-27 04:19:48', '2019-03-27 04:19:48'),
(29, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 263, 'dq25-28', 'keiko03851k', '＃台本はこんなふうだ。＃\r\n「ねえ、正解は１でしょ。そして本文に無いんでしょ。」', NULL, '2019-03-27 04:19:48', '2019-03-27 04:19:48'),
(30, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 265, 'dq25-29', 'keiko03851k', '次は、＃２　を選んで、そしてこれは本文に無い、＃ということになります。', NULL, '2019-03-27 04:19:48', '2019-03-27 04:19:48'),
(31, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 267, 'dq25-30', 'keiko03851k', '＃えらぶのは１にしてください。でもこれは本文に無い内容です。＃', NULL, '2019-03-27 04:19:48', '2019-03-27 04:19:48'),
(32, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 345, 'dq25-31', 'keiko03851k', '＃テイラー君＃は、トイレットペーパーを、包帯＊ほうたい＊の代わりに使った。２無', NULL, '2019-03-27 04:19:48', '2019-03-27 04:19:48'),
(33, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 351, 'dq25-32', 'keiko03851k', '道代は、白蛇伝説を＃怖いと思った。＃２無', NULL, '2019-03-27 04:19:48', '2019-03-27 04:19:48'),
(34, 76, 'michiko06841s', 0, 0, 46, 25, '人生の見本', '中山圭子　斉藤律子', 357, 'dq25-33', 'keiko03851k', '#「先輩の人生はまるでジェットコースターのようですね。」#と伸太郎は言った。２無', NULL, '2019-03-27 04:19:48', '2019-03-27 04:19:48'),
(35, 76, 'michiko06841s', 0, 7, 46, 25, '人生の見本', '中山圭子　斉藤律子', 252, NULL, 'keiko03851k', 'プロデューサーは言った。＃正しいのは１だけど、本文に無い。＃', NULL, '2019-03-27 04:19:49', '2019-03-27 04:19:49'),
(36, 3, 'keiko03851k', 0, 3, 51, 28, 'タージマハールのパワン君', '姫野桃花', NULL, NULL, NULL, '好きな本です。宜しくお願いします。', NULL, '2019-04-09 13:29:34', '2019-04-09 13:29:34'),
(37, 3, 'keiko03851k', 0, 4, 51, 28, 'タージマハールのパワン君', '姫野桃花', NULL, NULL, NULL, NULL, NULL, '2019-04-09 13:51:59', '2019-04-09 13:51:59'),
(38, 97, 'mariko06981k', 0, 3, 57, 29, '最後の一枚の葉', 'オー・ヘンリー', NULL, NULL, NULL, 'オーヘンリー短編集が大好きです。', NULL, '2019-04-26 14:51:15', '2019-04-26 14:51:15'),
(39, 3, 'keiko03851k', 0, 3, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', NULL, NULL, NULL, '宜しくお願い申し上げます。', NULL, '2019-04-26 14:53:32', '2019-04-26 14:53:32'),
(40, 97, 'mariko06981k', 0, 5, 57, 29, '最後の一枚の葉', 'オー・ヘンリー', NULL, NULL, NULL, NULL, NULL, '2019-04-26 14:55:36', '2019-04-26 14:55:36'),
(41, 3, 'keiko03851k', 0, 4, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', NULL, NULL, NULL, NULL, NULL, '2019-04-26 14:55:36', '2019-04-26 14:55:36'),
(42, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 364, 'dq29-1', 'daichi08922', 'スーとジョンジーは、＃音楽家＃でした。', NULL, '2019-04-26 15:06:42', '2019-04-26 15:06:42'),
(43, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 365, 'dq29-2', 'daichi08922', '病気になったのは、＃ジョンジーです。＃', NULL, '2019-04-26 15:06:42', '2019-04-26 15:06:42'),
(44, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 367, 'dq29-3', 'daichi08922', 'ジョンジーが数＊かず＊を数＊かぞ＊えていたのは、＃恋人からの手紙＃です。', NULL, '2019-04-26 15:06:42', '2019-04-26 15:06:42'),
(45, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 375, 'dq29-4', 'daichi08922', 'ジョンジーは、#大けがをして、ベッドに寝たきりになりました。#', NULL, '2019-04-26 15:06:42', '2019-04-26 15:06:42'),
(46, 3, 'keiko03851k', 0, 7, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 366, NULL, 'daichi08922', '医者は、＃助かる見込みは十に一つだと言いました。＃', NULL, '2019-04-26 15:06:43', '2019-04-26 15:06:43'),
(47, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 368, 'dq29-5', 'daichi08922', '医者は、＃ジョンシーに必要なのは、充分な睡眠だ＃、と言いました。', NULL, '2019-04-26 15:06:43', '2019-04-26 15:06:43'),
(48, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 370, 'dq29-6', 'daichi08922', '医者は、＃ジョンジーは、重い病気ではない＃と言っていました。', NULL, '2019-04-26 15:06:43', '2019-04-26 15:06:43'),
(49, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 372, 'dq29-7', 'daichi08922', '＃ジョンジーが助かるかどうかは、生きたいという気持ち次第だ＃、と医者は言いました。', NULL, '2019-04-26 15:06:43', '2019-04-26 15:06:43'),
(50, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 373, 'dq29-8', 'daichi08922', '＃ジョンジーは、自分はもう治らない、と思っていました。＃', NULL, '2019-04-26 15:06:43', '2019-04-26 15:06:43'),
(51, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 374, 'dq29-9', 'daichi08922', '＃スーの命＃は、本人が、生きたい、と思うかどうかにかかっていると医者は言った。', NULL, '2019-04-26 15:06:43', '2019-04-26 15:06:43'),
(52, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 376, 'dq29-10', 'daichi08922', '＃ジョンジーには、交際している男はいませんでした。＃', NULL, '2019-04-26 15:06:43', '2019-04-26 15:06:43'),
(53, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 377, 'dq29-11', 'daichi08922', 'ジョンジーは、窓の外を見ながら、＃数を数えていました。＃', NULL, '2019-04-26 15:06:43', '2019-04-26 15:06:43'),
(54, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 378, 'dq29-12', 'daichi08922', 'ジョンジーは、窓の外を見ながら低い声で＃歌を歌っていたのでした。＃', NULL, '2019-04-26 15:06:43', '2019-04-26 15:06:43'),
(55, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 380, 'dq29-13', 'daichi08922', 'ジョンジーが数えていたのは、＃アーモンドの木の葉っぱでした。＃', NULL, '2019-04-26 15:06:43', '2019-04-26 15:06:43'),
(56, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 381, 'dq29-14', 'daichi08922', 'ジョンジーが数えていたのは、＃つたの葉っぱでした。＃', NULL, '2019-04-26 15:06:43', '2019-04-26 15:06:43'),
(57, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 382, 'dq29-15', 'daichi08922', 'ジョンジーは、最後の一枚の葉が落ちるところを、＃見たくない＃、とスーに言いました。', NULL, '2019-04-26 15:06:43', '2019-04-26 15:06:43'),
(58, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 385, 'dq29-16', 'daichi08922', '＃ジョンジーと一緒に、スーも、つたの葉の数を数えました。＃', NULL, '2019-04-26 15:06:43', '2019-04-26 15:06:43'),
(59, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 386, 'dq29-17', 'daichi08922', 'ベーアマンさんは、＃無口＊むくち＊な若い画家でした。＃', NULL, '2019-04-26 15:06:43', '2019-04-26 15:06:43'),
(60, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 387, 'dq29-18', 'daichi08922', 'ベーアマンさんは、スーたちの下の階に住む画家でしたが、＃芸術的には失敗者でした。＃', NULL, '2019-04-26 15:06:43', '2019-04-26 15:06:43'),
(61, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 389, 'dq29-19', 'daichi08922', 'ベーアマンさんは画家ですが、＃それまで一度も傑作を描いたことがありませんでした。＃', NULL, '2019-04-26 15:06:43', '2019-04-26 15:06:43'),
(62, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 390, 'dq29-20', 'daichi08922', 'ベーアマンさんは、自分のことを、＃階上に住む2人の若い画家の番犬だと思っていました。＃', NULL, '2019-04-26 15:06:43', '2019-04-26 15:06:43'),
(63, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 392, 'dq29-21', 'daichi08922', 'ベーアマンさんはスーに、＃自分がジョンジーを救いたい、と言いました。＃', NULL, '2019-04-26 15:06:43', '2019-04-26 15:06:43'),
(64, 3, 'keiko03851k', 0, 0, 51, 29, '最後の一枚の葉', 'オー・ヘンリー', 393, 'dq29-22', 'daichi08922', 'ジョンジーは、つたの葉が、＃風が吹いても揺れないことに気が付きました。＃', NULL, '2019-04-26 15:06:43', '2019-04-26 15:06:43'),
