(128, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 449, 'dq30-36', 'Soichiro09842', 'ウーフのおとうさんはウーフに、#みんなが一ぴきぶん しっかりはたらけばいいのだ# といいました。', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(129, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 450, 'dq30-37', 'Soichiro09842', 'ウーフのおとうさんはウーフに、＃みんなが ひゃっぴきぶんはたらけば 貯水池*ちょすいち*がつくれる＃ といいました', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(130, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 451, 'dq30-38', 'Soichiro09842', 'ウーフはミミの家＊いえ＊の井戸＊いど＊で、水＊みず＊を すこししか もらいませんでした。それは、りすや ねずみから＃「そのばけつは ぼくらの ひゃっぱいぶんだよ」と いわれたからです＃', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(131, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 452, 'dq30-39', 'Soichiro09842', 'ウーフはミミの家＊いえ＊の井戸＊いど＊で、＃ばけつに たっぷりの 水＊みず＊を もらいました。＃　', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(132, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 454, 'dq30-40', 'Soichiro09842', '井戸＊いど＊のモーターがこしょうしたので、ウーフは うさぎのミミの家＊いえ＊の井戸へ水＊みず＊をもらいにいきました。＃でもウーフは、ほんのすこししか 水をもらいませんでした。＃', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(133, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 471, 'dq30-41', 'Soichiro09842', 'あつい夏＊なつ＊に あつい毛皮＊けがわ＊をきている くまは、おばかさんだ、といったのは、＃きつつきのゲラの おくさん＃です。', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(134, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 472, 'dq30-42', 'Soichiro09842', 'あつい夏＊なつ＊に あつい毛皮＊けがわ＊をきている くまは、おばかさんだ、といったのは、＃小鳥＊ことり＊のピピ＃です。　', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(135, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 473, 'dq30-43', 'Soichiro09842', '小鳥＊ことり＊のピピは ウーフに、＃毛皮＊けがわ＊を売＊う＊るとおかねもちになれる＃、と いいました。', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(136, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 474, 'dq30-44', 'Soichiro09842', 'ウーフの毛皮＊けがわ＊を ぬがすために、小鳥＊ことり＊のピピは ＃はさみを かりてきました。＃', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(137, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 475, 'dq30-45', 'Soichiro09842', 'こがね虫＊むし＊は、＃かねをいれた かばんを おっことして もんなしに なりました。＃', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(138, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 477, 'dq30-46', 'Soichiro09842', 'こがね虫＊むし＊はウーフに、＃おっことしたり なくしたり しないものだけを もっていればいい＃と  おしえてくれました。', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(139, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 478, 'dq30-47', 'Soichiro09842', 'ウーフは おかあさんに、こがね虫＊むし＊は  おかねを なくしたけれど、＃うつくしい ほうせき＃を もっていた、と はなしました。', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(140, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 479, 'dq30-48', 'Soichiro09842', 'ウーフは おかあさんに、こがね虫＊むし＊は  おかねを なくしたけれど、＃ちっちゃな にじ ＃を もっていた、と はなしました。', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(141, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 480, 'dq30-49', 'Soichiro09842', 'ウーフは、うさぎのミミの さがしものを みつけてあげました。それは ＃ボタン＃でした。　', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(142, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 481, 'dq30-50', 'Soichiro09842', 'うさぎの耳＊みみ＊は なぜ ながいのか、ウーフがきくと、ミミは、＃そんなことはわからない、といいました。＃', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(143, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 482, 'dq30-51', 'Soichiro09842', 'うさぎの耳＊みみ＊は なぜ ながいのか、ウーフがきくと、ミミは、＃うさぎは よわい どうぶつなので、よくきこえないと こまるのだ＃ と おしえてくれました。', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(144, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 483, 'dq30-52', 'Soichiro09842', 'なんでもよくきこえる耳＊みみ＊をもつ うさぎは、＃よわい＃動物＊どうぶつ＊なのだ、と うさぎのミミはいいました。', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(145, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 476, 'dq30-53', 'Soichiro09842', 'こがね虫*むし*はウーフに、＃おっことしたり なくしたり しないものは なにか＃を  おしえてくれました。', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(146, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 484, 'dq30-54', 'Soichiro09842', 'いくにちも雨＊あめ＊が ふらず、＃ウーフの家＊いえ＊の井戸＊いど＊は、水＊みず＊が かれてしまいました＃　', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(147, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 485, 'dq30-55', 'Soichiro09842', '川の水＊みず＊が なくなって、さかなが 手づかみでとれたので、＃ウーフは たくさんの さかなを つかまえました。＃　　', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(148, 97, 'mariko06981k', 0, 0, 57, 30, 'くまの子ウーフ', '神沢 利子', 486, 'dq30-56', 'Soichiro09842', '＃ウーフは たくさんの さかなを 町＊まち＊へ売＊う＊りに いきました＃　　', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(149, 3, 'keiko03851k', 0, 1, 51, 28, 'タージマハールのパワン君', '姫野 桃花', 487, NULL, NULL, 'パワンは＃バイク＃を盗まれた。', NULL, '2019-06-18 16:32:28', '2019-06-18 16:32:28'),
