INSERT INTO `person_quiz_history` (`id`, `user_id`, `username`, `item`, `work_test`, `age`, `book_id`, `title`, `writer`, `quiz_id`, `doq_quizid`, `quiz_point`, `point`, `rank`, `content`, `device`, `created_at`, `updated_at`) VALUES
(1, 83, 'chinatsu09291s', 0, 3, 30, 25, '人生の見本', '中山圭子　斉藤律子', 341, NULL, 0, 0, 10, '出かける前に大騒＊おおさわ＊ぎするのは、#アーサーです。#１前半', NULL, '2019-03-27 03:54:57', '2019-03-27 03:54:57'),
(2, 83, 'chinatsu09291s', 0, 3, 30, 25, '人生の見本', '中山圭子　斉藤律子', 342, NULL, 0, 0, 10, '答えは２である。そして、＃全体からの出題だ。＃', NULL, '2019-03-27 03:54:57', '2019-03-27 03:54:57'),
(3, 83, 'chinatsu09291s', 0, 3, 30, 25, '人生の見本', '中山圭子　斉藤律子', 343, NULL, 0, 0, 10, 'テーマを決めたのは、アレックスであった。２＃中盤＃', NULL, '2019-03-27 03:54:57', '2019-03-27 03:54:57'),
(4, 83, 'chinatsu09291s', 0, 3, 30, 25, '人生の見本', '中山圭子　斉藤律子', 344, NULL, 0, 0, 10, '＃天衣無縫＊てんいむほう＊＃という言葉を思いついたのは、孝明だった。１後半', NULL, '2019-03-27 03:54:57', '2019-03-27 03:54:57'),
(5, 83, 'chinatsu09291s', 0, 3, 30, 25, '人生の見本', '中山圭子　斉藤律子', 345, NULL, 0, 0, 10, '＃テイラー君＃は、トイレットペーパーを、包帯＊ほうたい＊の代わりに使った。２無', NULL, '2019-03-27 03:54:57', '2019-03-27 03:54:57'),
(6, 83, 'chinatsu09291s', 0, 3, 30, 25, '人生の見本', '中山圭子　斉藤律子', 346, NULL, 0, 0, 10, '答えは１で、出典は＃前半から＃です。', NULL, '2019-03-27 03:54:57', '2019-03-27 03:54:57'),
(7, 83, 'chinatsu09291s', 0, 3, 30, 25, '人生の見本', '中山圭子　斉藤律子', 347, NULL, 0, 0, 10, '「絶対＊ぜったい＊に勝＊か＊ってやる。」と宣言＊せんげん＊したのは、＃玄太だった。＃１中盤', NULL, '2019-03-27 03:54:57', '2019-03-27 03:54:57'),
(8, 83, 'chinatsu09291s', 0, 3, 30, 25, '人生の見本', '中山圭子　斉藤律子', 348, NULL, 0, 0, 10, '史郎が最上川のほとりで見つけたのは、＃つくし＃だった。２前', NULL, '2019-03-27 03:54:57', '2019-03-27 03:54:57'),
(9, 83, 'chinatsu09291s', 0, 3, 30, 25, '人生の見本', '中山圭子　斉藤律子', 349, NULL, 0, 0, 10, 'まりちゃんはミートパイを、＃おいしそうに＃食べた。２中', NULL, '2019-03-27 03:54:58', '2019-03-27 03:54:58'),
(10, 83, 'chinatsu09291s', 0, 3, 30, 25, '人生の見本', '中山圭子　斉藤律子', 350, NULL, 0, 0, 10, '大岡高校とシード権を争ったのは、＃第一高校＃である。２後半', NULL, '2019-03-27 03:54:58', '2019-03-27 03:54:58'),
(11, 83, 'chinatsu09291s', 0, 3, 30, 25, '人生の見本', '中山圭子　斉藤律子', 351, NULL, 0, 0, 10, '道代は、白蛇伝説を＃怖いと思った。＃２無', NULL, '2019-03-27 03:54:58', '2019-03-27 03:54:58'),
