(143, 122, 'yuzuru05972', 0, 3, 16, 28, 'タージマハールのパワン君', '姫野 桃花', 410, NULL, 0, 2.42, 10, '＃タージマハールでは、観光客が象に乗って、建物の周りを歩きます。＃２中盤', NULL, '2019-06-01 14:18:18', '2019-06-01 14:18:18'),
(144, 122, 'yuzuru05972', 0, 3, 16, 28, 'タージマハールのパワン君', '姫野 桃花', 411, NULL, 0, 2.42, 10, '「探し物は何ですか。見つけにくいものですか。カバンの中も机の中も探したけれど見つからないのに、まだまだ探す気ですか。それより僕と踊りませんか。夢の中へ、夢の中へ、行ってみたいと思いませんか。」と、パワン君は日本人の観光客に会うと歌って、#喜ばれました。#1中', NULL, '2019-06-01 14:18:18', '2019-06-01 14:18:18'),
(145, 122, 'yuzuru05972', 0, 3, 16, 28, 'タージマハールのパワン君', '姫野 桃花', 412, NULL, 0, 2.42, 10, 'パワン君は、観光客に、#大きなカバン#を売るのが仕事でした。１前', NULL, '2019-06-01 14:18:18', '2019-06-01 14:18:18'),
