(162, 97, 'mariko06981k', 0, 3, 57, 30, 'くまの子ウーフ', '神沢 利子', 427, NULL, 0, 26.56, 9, 'ウーフが　ふなの口の中をみてびっくりしたのは、ふなの口の中に＃したが なかった＃からです', NULL, '2019-06-15 04:11:05', '2019-06-15 04:11:05'),
(163, 97, 'mariko06981k', 0, 3, 57, 30, 'くまの子ウーフ', '神沢 利子', 428, NULL, 0, 26.56, 9, 'ウーフのおかあさんは、＃さかなにも　まぶたがある＃　と　おしえてくれました。', NULL, '2019-06-15 04:11:05', '2019-06-15 04:11:05'),
(164, 97, 'mariko06981k', 0, 3, 57, 30, 'くまの子ウーフ', '神沢 利子', 429, NULL, 0, 26.56, 9, 'ウーフのおかあさんは、＃さかなには はじめから したがないのだ＃　と　おしえてくれました。', NULL, '2019-06-15 04:11:05', '2019-06-15 04:11:05'),
(165, 97, 'mariko06981k', 0, 3, 57, 30, 'くまの子ウーフ', '神沢 利子', 430, NULL, 0, 26.56, 9, 'ウーフのおかあさんは、＃さかなは　はちみつをなめなくてもいいから、したはいらないのだ＃　といいました　', NULL, '2019-06-15 04:11:05', '2019-06-15 04:11:05'),
(166, 97, 'mariko06981k', 0, 3, 57, 30, 'くまの子ウーフ', '神沢 利子', 431, NULL, 0, 26.56, 9, 'ウーフは、したがあると　＃はちみつがなめられる＃ので、したがあることを　うれしいとおもいました。', NULL, '2019-06-15 04:11:05', '2019-06-15 04:11:05'),
(167, 97, 'mariko06981k', 0, 3, 57, 30, 'くまの子ウーフ', '神沢 利子', 432, NULL, 0, 26.56, 9, 'ウーフは、たまごをわると　いつも　＃おなじものがでてくる＃ことに　感心＊かんしん＊しました。', NULL, '2019-06-15 04:11:05', '2019-06-15 04:11:05'),
(168, 97, 'mariko06981k', 0, 3, 57, 30, 'くまの子ウーフ', '神沢 利子', 433, NULL, 0, 26.56, 9, '#ウーフが たまごをわったら　ビー玉*だま*が出てきました#', NULL, '2019-06-15 04:11:06', '2019-06-15 04:11:06'),
(169, 97, 'mariko06981k', 0, 3, 57, 30, 'くまの子ウーフ', '神沢 利子', 434, NULL, 0, 26.56, 9, 'からだの中に　たまごは百＊ひゃく＊くらいはいっているのか、ときかれて、めんどりは、＃百より　おおいんじゃないかしら＃　と　こたえました。', NULL, '2019-06-15 04:11:06', '2019-06-15 04:11:06'),
(170, 126, 'sinnosuke03562', 0, 3, 7, 30, 'くまの子ウーフ', '神沢 利子', 435, NULL, 0, 0, 10, 'めんどりは　たまごでできている、といったのは　＃ツネタ＃です。', NULL, '2019-06-15 04:56:48', '2019-06-15 04:56:48'),
(171, 126, 'sinnosuke03562', 0, 3, 7, 30, 'くまの子ウーフ', '神沢 利子', 436, NULL, 0, 0, 10, 'ウーフはおしっこでできている、といったのは　＃ツネタ＃です。', NULL, '2019-06-15 04:56:48', '2019-06-15 04:56:48'),
(172, 126, 'sinnosuke03562', 0, 3, 7, 30, 'くまの子ウーフ', '神沢 利子', 437, NULL, 0, 0, 10, 'ウーフはころんだときに、＃おしっこをもらしてしまいました＃', NULL, '2019-06-15 04:56:48', '2019-06-15 04:56:48'),
(173, 126, 'sinnosuke03562', 0, 3, 7, 30, 'くまの子ウーフ', '神沢 利子', 438, NULL, 0, 0, 10, 'からだからは おしっこだけでなく、ちと なみだも でる、といったのは、＃ツネタ＃です。', NULL, '2019-06-15 04:56:48', '2019-06-15 04:56:48'),
(174, 126, 'sinnosuke03562', 0, 3, 7, 30, 'くまの子ウーフ', '神沢 利子', 439, NULL, 0, 0, 10, 'ウーフはウーフでできている、といったのは、＃おとうさん＃です。', NULL, '2019-06-15 04:56:48', '2019-06-15 04:56:48'),
(175, 126, 'sinnosuke03562', 0, 3, 7, 30, 'くまの子ウーフ', '神沢 利子', 440, NULL, 0, 0, 10, 'かんろくつけたなあ、とツネタからいわれたウーフは、＃かんろくって、土＊つち＊のことかしら、とおもいました＃', NULL, '2019-06-15 04:56:48', '2019-06-15 04:56:48'),
(176, 126, 'sinnosuke03562', 0, 3, 7, 30, 'くまの子ウーフ', '神沢 利子', 441, NULL, 0, 0, 10, 'ウーフがおかあさんに おふろで からだを あらってもらったとき、ウーフのからだから ＃こねずみ＃が でてきました。', NULL, '2019-06-15 04:56:48', '2019-06-15 04:56:48'),
(177, 126, 'sinnosuke03562', 0, 3, 7, 30, 'くまの子ウーフ', '神沢 利子', 442, NULL, 0, 0, 10, 'てんとう虫や かみきり虫がやってきて ウーフの毛＊け＊の中に はいったのは、ウーフが＃ふえ＃をふいたからです', NULL, '2019-06-15 04:56:49', '2019-06-15 04:56:49'),
(178, 126, 'sinnosuke03562', 0, 3, 7, 30, 'くまの子ウーフ', '神沢 利子', 443, NULL, 0, 0, 10, 'りすのばあい きれいにしておくと いざというとき やくだつものは しっぽです。ウーフのばあい きれいにしておくと いざというとき やくだつものは ＃つめ＃です。', NULL, '2019-06-15 04:56:49', '2019-06-15 04:56:49'),
(179, 126, 'sinnosuke03562', 0, 3, 7, 30, 'くまの子ウーフ', '神沢 利子', 444, NULL, 0, 0, 10, 'きつつきのゲラさんが みつけた たからものとは、＃およめさん＃のことです。', NULL, '2019-06-15 04:56:49', '2019-06-15 04:56:49'),
(180, 126, 'sinnosuke03562', 0, 3, 7, 30, 'くまの子ウーフ', '神沢 利子', 445, NULL, 0, 0, 10, 'きつつきのゲラさんがみつけた たからものは、＃きらきらひかる いし＃ でした。', NULL, '2019-06-15 04:56:49', '2019-06-15 04:56:49'),
(181, 126, 'sinnosuke03562', 0, 3, 7, 30, 'くまの子ウーフ', '神沢 利子', 446, NULL, 0, 0, 10, 'ツネタがウーフに　「かんろく つけたなあ。」といったのは、＃ウーフが ふとったから＃です。', NULL, '2019-06-15 04:56:49', '2019-06-15 04:56:49'),
(182, 137, 'Tae01351', 0, 6, 34, 30, 'くまの子ウーフ', '神沢 利子', 453, NULL, NULL, 0, 10, 'ウーフはミミの家＊いえ＊の井戸＊いど＊で、＃ばけつに いっぱいの水＊みず＊を もらいました＃　', NULL, '2019-06-15 07:48:15', '2019-06-15 07:48:15'),
