(185, 137, 'Tae01351', 0, 3, 34, 30, 'くまの子ウーフ', '神沢 利子', 449, NULL, 0, 0, 10, 'ウーフのおとうさんはウーフに、#みんなが一ぴきぶん しっかりはたらけばいいのだ# といいました。', NULL, '2019-06-15 08:27:54', '2019-06-15 08:27:54'),
(186, 137, 'Tae01351', 0, 3, 34, 30, 'くまの子ウーフ', '神沢 利子', 450, NULL, 0, 0, 10, 'ウーフのおとうさんはウーフに、＃みんなが ひゃっぴきぶんはたらけば 貯水池*ちょすいち*がつくれる＃ といいました', NULL, '2019-06-15 08:27:54', '2019-06-15 08:27:54'),
(187, 137, 'Tae01351', 0, 3, 34, 30, 'くまの子ウーフ', '神沢 利子', 451, NULL, 0, 0, 10, 'ウーフはミミの家＊いえ＊の井戸＊いど＊で、水＊みず＊を すこししか もらいませんでした。それは、りすや ねずみから＃「そのばけつは ぼくらの ひゃっぱいぶんだよ」と いわれたからです＃', NULL, '2019-06-15 08:27:54', '2019-06-15 08:27:54'),
(188, 137, 'Tae01351', 0, 3, 34, 30, 'くまの子ウーフ', '神沢 利子', 452, NULL, 0, 0, 10, 'ウーフはミミの家＊いえ＊の井戸＊いど＊で、＃ばけつに たっぷりの 水＊みず＊を もらいました。＃　', NULL, '2019-06-15 08:27:55', '2019-06-15 08:27:55'),
(189, 137, 'Tae01351', 0, 3, 34, 30, 'くまの子ウーフ', '神沢 利子', 454, NULL, 0, 0, 10, '井戸＊いど＊のモーターがこしょうしたので、ウーフは うさぎのミミの家＊いえ＊の井戸へ水＊みず＊をもらいにいきました。＃でもウーフは、ほんのすこししか 水をもらいませんでした。＃', NULL, '2019-06-15 08:27:55', '2019-06-15 08:27:55'),
(190, 137, 'Tae01351', 0, 3, 34, 30, 'くまの子ウーフ', '神沢 利子', 455, NULL, 0, 0, 10, '＃ツネタは、たくさんのさかなを、町＊まち＊へ売＊う＊りにいきました。＃　', NULL, '2019-06-15 08:27:55', '2019-06-15 08:27:55'),
(191, 137, 'Tae01351', 0, 3, 34, 30, 'くまの子ウーフ', '神沢 利子', 456, NULL, 0, 0, 10, 'ウーフが まどを しめたとき、＃ちようちょ＃が まどに はさまって しんでしまいました。', NULL, '2019-06-15 08:27:55', '2019-06-15 08:27:55'),
(192, 137, 'Tae01351', 0, 3, 34, 30, 'くまの子ウーフ', '神沢 利子', 457, NULL, 0, 0, 10, 'ウーフは、とんぼが しんだときも、てんとう虫が しんだときも、＃えんえん なきました。＃', NULL, '2019-06-15 08:27:55', '2019-06-15 08:27:55'),
(193, 137, 'Tae01351', 0, 3, 34, 30, 'くまの子ウーフ', '神沢 利子', 458, NULL, 0, 0, 10, 'ウーフは、とんぼが しんだときも、てんとう虫＊むし＊が しんだときも、＃なきませんでした。＃', NULL, '2019-06-15 08:27:55', '2019-06-15 08:27:55'),
(194, 137, 'Tae01351', 0, 3, 34, 30, 'くまの子ウーフ', '神沢 利子', 459, NULL, 0, 0, 10, 'ウーフが まどを しめたとき、まどに はさまって しんでしまったのは、＃とんぼ＃です。　', NULL, '2019-06-15 08:27:55', '2019-06-15 08:27:55'),
(195, 137, 'Tae01351', 0, 3, 34, 30, 'くまの子ウーフ', '神沢 利子', 460, NULL, 0, 0, 10, '＃ウーフは、＃ちょうちょのおはかに ドロップを おそなえしました。', NULL, '2019-06-15 08:27:55', '2019-06-15 08:27:55'),
