(197, 137, 'Tae01351', 0, 3, 34, 30, 'くまの子ウーフ', '神沢 利子', 462, NULL, 0, 0, 10, 'ありが いっぱい たかっていたドロップを、ウーフは ＃ぺろりと なめました。＃　', NULL, '2019-06-15 08:27:56', '2019-06-15 08:27:56'),
(198, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 463, NULL, 0, 19.17, 10, 'ゲラさんたちの たまごを どろぼうしようとしたのは ＃カラスです。＃', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
