(203, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 468, NULL, 0, 19.17, 10, 'ゲラさんたちに、＃5わのひよこ＃が うまれました。', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
(204, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 469, NULL, 0, 19.17, 10, 'きつつきの ゲラさんが いそがしくなったのは、＃おくさんが びょうきになってしまったからです。＃', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
(205, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 470, NULL, 0, 19.17, 10, 'きつつきのゲラさんが いそがしくなったのは、＃５わの ひよこの おとうさんになったからです。＃', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
(206, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 471, NULL, 0, 19.17, 10, 'あつい夏＊なつ＊に あつい毛皮＊けがわ＊をきている くまは、おばかさんだ、といったのは、＃きつつきのゲラの おくさん＃です。', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
(207, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 472, NULL, 0, 19.17, 10, 'あつい夏＊なつ＊に あつい毛皮＊けがわ＊をきている くまは、おばかさんだ、といったのは、＃小鳥＊ことり＊のピピ＃です。　', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
(208, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 473, NULL, 0, 19.17, 10, '小鳥＊ことり＊のピピは ウーフに、＃毛皮＊けがわ＊を売＊う＊るとおかねもちになれる＃、と いいました。', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
(209, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 474, NULL, 0, 19.17, 10, 'ウーフの毛皮＊けがわ＊を ぬがすために、小鳥＊ことり＊のピピは ＃はさみを かりてきました。＃', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
(210, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 475, NULL, 0, 19.17, 10, 'こがね虫＊むし＊は、＃かねをいれた かばんを おっことして もんなしに なりました。＃', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
(211, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 476, NULL, 0, 19.17, 10, 'こがね虫*むし*はウーフに、＃おっことしたり なくしたり しないものは なにか＃を  おしえてくれました。', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
(212, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 477, NULL, 0, 19.17, 10, 'こがね虫＊むし＊はウーフに、＃おっことしたり なくしたり しないものだけを もっていればいい＃と  おしえてくれました。', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
(213, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 478, NULL, 0, 19.17, 10, 'ウーフは おかあさんに、こがね虫＊むし＊は  おかねを なくしたけれど、＃うつくしい ほうせき＃を もっていた、と はなしました。', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
(214, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 479, NULL, 0, 19.17, 10, 'ウーフは おかあさんに、こがね虫＊むし＊は  おかねを なくしたけれど、＃ちっちゃな にじ ＃を もっていた、と はなしました。', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
(215, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 480, NULL, 0, 19.17, 10, 'ウーフは、うさぎのミミの さがしものを みつけてあげました。それは ＃ボタン＃でした。　', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
(216, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 481, NULL, 0, 19.17, 10, 'うさぎの耳＊みみ＊は なぜ ながいのか、ウーフがきくと、ミミは、＃そんなことはわからない、といいました。＃', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
(217, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 482, NULL, 0, 19.17, 10, 'うさぎの耳＊みみ＊は なぜ ながいのか、ウーフがきくと、ミミは、＃うさぎは よわい どうぶつなので、よくきこえないと こまるのだ＃ と おしえてくれました。', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
(218, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 483, NULL, 0, 19.17, 10, 'なんでもよくきこえる耳＊みみ＊をもつ うさぎは、＃よわい＃動物＊どうぶつ＊なのだ、と うさぎのミミはいいました。', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
(219, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 484, NULL, 0, 19.17, 10, 'いくにちも雨＊あめ＊が ふらず、＃ウーフの家＊いえ＊の井戸＊いど＊は、水＊みず＊が かれてしまいました＃　', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
(220, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 485, NULL, 0, 19.17, 10, '川の水＊みず＊が なくなって、さかなが 手づかみでとれたので、＃ウーフは たくさんの さかなを つかまえました。＃　　', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
(221, 106, 'alex05342', 0, 3, 29, 30, 'くまの子ウーフ', '神沢 利子', 486, NULL, 0, 19.17, 10, '＃ウーフは たくさんの さかなを 町＊まち＊へ売＊う＊りに いきました＃　　', NULL, '2019-06-15 09:33:17', '2019-06-15 09:33:17'),
(222, 138, 'Soichiro09842', 0, 4, 8, 30, 'くまの子ウーフ', '神沢 利子', 421, 'dq30-1', 0.05, 0.08, 10, 'ウーフが　みつばちになりたい　とおもったのは、#そらをとびたかったから#です', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(223, 138, 'Soichiro09842', 0, 4, 8, 30, 'くまの子ウーフ', '神沢 利子', 422, 'dq30-2', 0.05, 0.12, 10, '#ウーフは川にはいって　めだかをたくさんつかまえました#', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(224, 138, 'Soichiro09842', 0, 4, 8, 30, 'くまの子ウーフ', '神沢 利子', 423, 'dq30-3', 0.05, 0.16, 10, '川の中から　ふなが　かおをだして、ウーフに#こぐまくん、こんにちは#　といいました。', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(225, 138, 'Soichiro09842', 0, 4, 8, 30, 'くまの子ウーフ', '神沢 利子', 424, 'dq30-4', 0.05, 0.2, 10, 'ふなは　ウーフのことを　#くまこう#　と　よびました。', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(226, 138, 'Soichiro09842', 0, 4, 8, 30, 'くまの子ウーフ', '神沢 利子', 425, 'dq30-5', 0.05, 0.24, 10, '100までかぞえるあいだ　 目をつぶらないで いることが できたので　ウーフは、#ふなに　ほめてもらえました。#', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(227, 138, 'Soichiro09842', 0, 4, 8, 30, 'くまの子ウーフ', '神沢 利子', 426, 'dq30-6', 0.05, 0.28, 10, 'ウーフが　ふなの口の中をみてびっくりしたのは、#ふなの口の中に　したがあったから#です。', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(228, 126, 'sinnosuke03562', 0, 4, 7, 30, 'くまの子ウーフ', '神沢 利子', 435, 'dq30-7', 0.05, 0.04, 10, 'めんどりは　たまごでできている、といったのは　＃ツネタ＃です。', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(229, 126, 'sinnosuke03562', 0, 4, 7, 30, 'くまの子ウーフ', '神沢 利子', 436, 'dq30-8', 0.05, 0.08, 10, 'ウーフはおしっこでできている、といったのは　＃ツネタ＃です。', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(230, 126, 'sinnosuke03562', 0, 4, 7, 30, 'くまの子ウーフ', '神沢 利子', 437, 'dq30-9', 0.05, 0.12, 10, 'ウーフはころんだときに、＃おしっこをもらしてしまいました＃', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(231, 126, 'sinnosuke03562', 0, 4, 7, 30, 'くまの子ウーフ', '神沢 利子', 438, 'dq30-10', 0.05, 0.16, 10, 'からだからは おしっこだけでなく、ちと なみだも でる、といったのは、＃ツネタ＃です。', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(232, 126, 'sinnosuke03562', 0, 4, 7, 30, 'くまの子ウーフ', '神沢 利子', 439, 'dq30-11', 0.05, 0.2, 10, 'ウーフはウーフでできている、といったのは、＃おとうさん＃です。', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(233, 126, 'sinnosuke03562', 0, 4, 7, 30, 'くまの子ウーフ', '神沢 利子', 446, 'dq30-12', 0.05, 0.24, 10, 'ツネタがウーフに　「かんろく つけたなあ。」といったのは、＃ウーフが ふとったから＃です。', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(234, 137, 'Tae01351', 0, 4, 34, 30, 'くまの子ウーフ', '神沢 利子', 455, 'dq30-13', 0.05, 0.04, 10, '＃ツネタは、たくさんのさかなを、町＊まち＊へ売＊う＊りにいきました。＃　', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(235, 126, 'sinnosuke03562', 0, 4, 7, 30, 'くまの子ウーフ', '神沢 利子', 440, 'dq30-14', 0.05, 0.28, 10, 'かんろくつけたなあ、とツネタからいわれたウーフは、＃かんろくって、土＊つち＊のことかしら、とおもいました＃', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(236, 126, 'sinnosuke03562', 0, 4, 7, 30, 'くまの子ウーフ', '神沢 利子', 441, 'dq30-15', 0.05, 0.32, 10, 'ウーフがおかあさんに おふろで からだを あらってもらったとき、ウーフのからだから ＃こねずみ＃が でてきました。', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(237, 126, 'sinnosuke03562', 0, 4, 7, 30, 'くまの子ウーフ', '神沢 利子', 442, 'dq30-16', 0.05, 0.36, 10, 'てんとう虫や かみきり虫がやってきて ウーフの毛＊け＊の中に はいったのは、ウーフが＃ふえ＃をふいたからです', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(238, 126, 'sinnosuke03562', 0, 4, 7, 30, 'くまの子ウーフ', '神沢 利子', 443, 'dq30-17', 0.05, 0.4, 10, 'りすのばあい きれいにしておくと いざというとき やくだつものは しっぽです。ウーフのばあい きれいにしておくと いざというとき やくだつものは ＃つめ＃です。', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(239, 126, 'sinnosuke03562', 0, 4, 7, 30, 'くまの子ウーフ', '神沢 利子', 444, 'dq30-18', 0, 0.4, 10, 'きつつきのゲラさんが みつけた たからものとは、＃およめさん＃のことです。', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(240, 126, 'sinnosuke03562', 0, 4, 7, 30, 'くまの子ウーフ', '神沢 利子', 445, 'dq30-19', 0, 0.4, 10, 'きつつきのゲラさんがみつけた たからものは、＃きらきらひかる いし＃ でした。', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(241, 137, 'Tae01351', 0, 4, 34, 30, 'くまの子ウーフ', '神沢 利子', 456, 'dq30-20', 0.05, 0.08, 10, 'ウーフが まどを しめたとき、＃ちようちょ＃が まどに はさまって しんでしまいました。', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
(242, 137, 'Tae01351', 0, 4, 34, 30, 'くまの子ウーフ', '神沢 利子', 457, 'dq30-21', 0.05, 0.12, 10, 'ウーフは、とんぼが しんだときも、てんとう虫が しんだときも、＃えんえん なきました。＃', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
