(244, 137, 'Tae01351', 0, 4, 34, 30, 'くまの子ウーフ', '神沢 利子', 459, 'dq30-23', 0.05, 0.2, 10, 'ウーフが まどを しめたとき、まどに はさまって しんでしまったのは、＃とんぼ＃です。　', NULL, '2019-06-15 09:43:23', '2019-06-15 09:43:23'),
