(263, 106, 'alex05342', 0, 4, 29, 30, 'くまの子ウーフ', '神沢 利子', 471, 'dq30-41', 0.05, 19.48, 10, 'あつい夏＊なつ＊に あつい毛皮＊けがわ＊をきている くまは、おばかさんだ、といったのは、＃きつつきのゲラの おくさん＃です。', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(264, 106, 'alex05342', 0, 4, 29, 30, 'くまの子ウーフ', '神沢 利子', 472, 'dq30-42', 0.05, 19.53, 10, 'あつい夏＊なつ＊に あつい毛皮＊けがわ＊をきている くまは、おばかさんだ、といったのは、＃小鳥＊ことり＊のピピ＃です。　', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(265, 106, 'alex05342', 0, 4, 29, 30, 'くまの子ウーフ', '神沢 利子', 473, 'dq30-43', 0.05, 19.57, 10, '小鳥＊ことり＊のピピは ウーフに、＃毛皮＊けがわ＊を売＊う＊るとおかねもちになれる＃、と いいました。', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(266, 106, 'alex05342', 0, 4, 29, 30, 'くまの子ウーフ', '神沢 利子', 474, 'dq30-44', 0, 19.57, 10, 'ウーフの毛皮＊けがわ＊を ぬがすために、小鳥＊ことり＊のピピは ＃はさみを かりてきました。＃', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(267, 106, 'alex05342', 0, 4, 29, 30, 'くまの子ウーフ', '神沢 利子', 475, 'dq30-45', 0, 19.57, 10, 'こがね虫＊むし＊は、＃かねをいれた かばんを おっことして もんなしに なりました。＃', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(268, 106, 'alex05342', 0, 4, 29, 30, 'くまの子ウーフ', '神沢 利子', 477, 'dq30-46', 0, 19.57, 10, 'こがね虫＊むし＊はウーフに、＃おっことしたり なくしたり しないものだけを もっていればいい＃と  おしえてくれました。', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(269, 106, 'alex05342', 0, 4, 29, 30, 'くまの子ウーフ', '神沢 利子', 478, 'dq30-47', 0, 19.57, 10, 'ウーフは おかあさんに、こがね虫＊むし＊は  おかねを なくしたけれど、＃うつくしい ほうせき＃を もっていた、と はなしました。', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(270, 106, 'alex05342', 0, 4, 29, 30, 'くまの子ウーフ', '神沢 利子', 479, 'dq30-48', 0, 19.57, 10, 'ウーフは おかあさんに、こがね虫＊むし＊は  おかねを なくしたけれど、＃ちっちゃな にじ ＃を もっていた、と はなしました。', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(271, 106, 'alex05342', 0, 4, 29, 30, 'くまの子ウーフ', '神沢 利子', 480, 'dq30-49', 0, 19.57, 10, 'ウーフは、うさぎのミミの さがしものを みつけてあげました。それは ＃ボタン＃でした。　', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(272, 106, 'alex05342', 0, 4, 29, 30, 'くまの子ウーフ', '神沢 利子', 481, 'dq30-50', 0, 19.57, 10, 'うさぎの耳＊みみ＊は なぜ ながいのか、ウーフがきくと、ミミは、＃そんなことはわからない、といいました。＃', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(273, 106, 'alex05342', 0, 4, 29, 30, 'くまの子ウーフ', '神沢 利子', 482, 'dq30-51', 0, 19.57, 10, 'うさぎの耳＊みみ＊は なぜ ながいのか、ウーフがきくと、ミミは、＃うさぎは よわい どうぶつなので、よくきこえないと こまるのだ＃ と おしえてくれました。', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24');
