(274, 106, 'alex05342', 0, 4, 29, 30, 'くまの子ウーフ', '神沢 利子', 483, 'dq30-52', 0, 19.57, 10, 'なんでもよくきこえる耳＊みみ＊をもつ うさぎは、＃よわい＃動物＊どうぶつ＊なのだ、と うさぎのミミはいいました。', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(275, 106, 'alex05342', 0, 4, 29, 30, 'くまの子ウーフ', '神沢 利子', 476, 'dq30-53', 0, 19.57, 10, 'こがね虫*むし*はウーフに、＃おっことしたり なくしたり しないものは なにか＃を  おしえてくれました。', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(276, 106, 'alex05342', 0, 4, 29, 30, 'くまの子ウーフ', '神沢 利子', 484, 'dq30-54', 0, 19.57, 10, 'いくにちも雨＊あめ＊が ふらず、＃ウーフの家＊いえ＊の井戸＊いど＊は、水＊みず＊が かれてしまいました＃　', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(277, 106, 'alex05342', 0, 4, 29, 30, 'くまの子ウーフ', '神沢 利子', 485, 'dq30-55', 0, 19.57, 10, '川の水＊みず＊が なくなって、さかなが 手づかみでとれたので、＃ウーフは たくさんの さかなを つかまえました。＃　　', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
(278, 106, 'alex05342', 0, 4, 29, 30, 'くまの子ウーフ', '神沢 利子', 486, 'dq30-56', 0, 19.57, 10, '＃ウーフは たくさんの さかなを 町＊まち＊へ売＊う＊りに いきました＃　　', NULL, '2019-06-15 09:43:24', '2019-06-15 09:43:24'),
