(177, 21, 73, 2, 'これは＃答えが２の問題だ＃ということは確かである。', 0, 199, 2, 2, '2019-01-17 05:13:33', 0, '2019-01-17 03:42:14', '2019-01-17 05:13:33', 12, 'dq21-21'),
(178, 21, 73, 2, 'はっきり言って、＃正解は１#である。', 1, 100, 1, 2, '2019-01-17 05:13:33', 0, '2019-01-17 03:44:02', '2019-01-17 05:13:33', 12, 'dq21-10'),
(179, 21, 12, 2, '#美智子#は、正解が２であることをすでに知っていた。', 0, 40, 0, 2, '2019-02-07 07:35:40', 0, '2019-01-17 03:46:01', '2019-02-07 07:35:40', 12, 'dq21-1'),
(180, 21, 12, 2, '確かなことは、＃これの答えは１だ＃ということである。', 1, NULL, 4, 2, '2019-01-17 05:13:33', 0, '2019-01-17 03:47:22', '2019-04-28 07:02:56', 12, 'dq21-36'),
