(478, 30, 106, 1, 'ウーフは おかあさんに、こがね虫＊むし＊は  おかねを なくしたけれど、＃うつくしい ほうせき＃を もっていた、と はなしました。', 0, 101, 2, 2, '2019-06-15 09:43:24', 0, '2019-06-15 09:13:56', '2019-06-15 09:43:24', 97, 'dq30-55'),
(479, 30, 106, 1, 'ウーフは おかあさんに、こがね虫＊むし＊は  おかねを なくしたけれど、＃ちっちゃな にじ ＃を もっていた、と はなしました。', 1, 101, 2, 2, '2019-06-15 09:43:24', 0, '2019-06-15 09:14:36', '2019-06-15 09:43:24', 97, 'dq30-56'),
(480, 30, 106, 1, 'ウーフは、うさぎのミミの さがしものを みつけてあげました。それは ＃ボタン＃でした。　', 1, 104, 2, 2, '2019-06-15 09:43:24', 0, '2019-06-15 09:17:55', '2019-06-15 09:43:24', 97, 'dq30-57'),
(481, 30, 106, 1, 'うさぎの耳＊みみ＊は なぜ ながいのか、ウーフがきくと、ミミは、＃そんなことはわからない、といいました。＃', 0, 105, 2, 2, '2019-06-15 09:43:24', 0, '2019-06-15 09:19:57', '2019-06-15 09:43:24', 97, 'dq30-58'),
(482, 30, 106, 1, 'うさぎの耳＊みみ＊は なぜ ながいのか、ウーフがきくと、ミミは、＃うさぎは よわい どうぶつなので、よくきこえないと こまるのだ＃ と おしえてくれました。', 1, 105, 2, 2, '2019-06-15 09:43:24', 0, '2019-06-15 09:22:29', '2019-06-15 09:43:24', 97, 'dq30-59'),
(483, 30, 106, 1, 'なんでもよくきこえる耳＊みみ＊をもつ うさぎは、＃よわい＃動物＊どうぶつ＊なのだ、と うさぎのミミはいいました。', 1, 105, 2, 2, '2019-06-15 09:43:24', 0, '2019-06-15 09:25:33', '2019-06-15 09:43:24', 97, 'dq30-60'),
(484, 30, 106, 1, 'いくにちも雨＊あめ＊が ふらず、＃ウーフの家＊いえ＊の井戸＊いど＊は、水＊みず＊が かれてしまいました＃　', 0, 113, 4, 2, '2019-06-15 09:43:24', 0, '2019-06-15 09:27:40', '2019-06-15 09:43:24', 97, 'dq30-62'),
(485, 30, 106, 1, '川の水＊みず＊が なくなって、さかなが 手づかみでとれたので、＃ウーフは たくさんの さかなを つかまえました。＃　　', 0, 118, 4, 2, '2019-06-15 09:43:24', 0, '2019-06-15 09:29:30', '2019-06-15 09:43:24', 97, 'dq30-63'),
(486, 30, 106, 1, '＃ウーフは たくさんの さかなを 町＊まち＊へ売＊う＊りに いきました＃　　', 0, 118, 4, 2, '2019-06-15 09:43:24', 0, '2019-06-15 09:31:11', '2019-06-15 09:43:24', 97, 'dq30-64'),
(487, 28, 3, 1, 'パワンは＃バイク＃を盗まれなかった。1中', 1, NULL, 1, 2, NULL, 0, '2019-06-18 16:30:27', '2019-08-20 02:52:23', 3, NULL),
(488, 28, 3, 1, '中２パワンは＃車＃を盗＊ぬす＊まれた。', 0, NULL, 1, 2, NULL, 0, '2019-06-18 16:32:03', '2019-08-20 02:52:55', 3, NULL),
(489, 31, 123, 3, 'こたえは１　＃後半＃', 1, 101, 2, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:06:39', '2019-06-29 13:46:49', 74, 'dq31-12'),
(490, 31, 123, 3, 'ターゲットはもちろん＃２　中盤＃', 0, 71, 1, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:07:49', '2019-06-29 13:46:49', 74, 'dq31-6'),
(491, 31, 123, 3, '傍線部＊ぼうせんぶ＊を忘れずに＃２前半＃', 0, 9, 0, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:08:49', '2019-06-29 13:46:49', 74, 'dq31-2'),
(492, 31, 123, 3, '＃こたえは２です。本文にない＃', 0, NULL, 4, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:09:30', '2019-06-29 13:46:49', 74, 'dq31-23'),
(493, 31, 123, 3, '正解＊せいかい＊は、１です。出典＊しゅってん＊は＃後半＃', 1, 112, 2, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:10:34', '2019-06-29 13:46:49', 74, 'dq31-13'),
(494, 31, 123, 3, '＃こたえは２後半＃', 0, 120, 2, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:11:19', '2019-06-29 13:46:49', 74, 'dq31-14'),
(495, 31, 123, 3, 'こたえは＃１です。中盤＃', 1, 79, 1, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:12:08', '2019-06-29 13:46:49', 74, 'dq31-7'),
(496, 31, 123, 3, '＃２です＃。全体から', 0, NULL, 3, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:12:51', '2019-06-29 13:46:49', 74, 'dq31-19'),
(497, 31, 123, 3, 'はいそうです。答えは＃１＃。後半からです。', 1, 99, 2, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:13:25', '2019-06-29 13:46:49', 74, 'dq31-15'),
(498, 31, 123, 3, 'その答えは＃２です。＃前半', 0, 30, 0, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:14:05', '2019-06-29 13:46:49', 74, 'dq31-3'),
(499, 31, 123, 3, '大変です。＃答えは２です。＃前半', 0, 35, 0, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:14:48', '2019-06-29 13:46:49', 74, 'dq31-4'),
(500, 31, 123, 3, '一郎くんは、正しいです。答えは＃１で中盤からです。＃', 1, 84, 1, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:15:43', '2019-06-29 13:46:49', 74, 'dq31-8'),
(501, 31, 123, 3, 'せいかいは２です。＃そして本文に無い＃', 0, NULL, 4, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:16:28', '2019-06-29 13:46:49', 74, 'dq31-24'),
(502, 31, 123, 3, '一郎くんは、いい子です。＃答えは１＃で、後半からです。', 1, 100, 2, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:17:16', '2019-06-29 13:46:49', 74, 'dq31-16'),
(503, 31, 123, 3, 'それは２です。#全体から#です。', 0, NULL, 3, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:17:57', '2019-06-29 13:46:49', 74, 'dq31-20'),
(504, 31, 137, 1, 'だいじなことは＃こたえが２＃で中盤からということです。', 0, 91, 1, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:37:02', '2019-06-29 13:46:49', 74, 'dq31-9'),
(505, 31, 137, 1, '＃そうです２です＃。そして本文に無いです。', 0, NULL, 4, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:37:40', '2019-06-29 13:46:49', 74, 'dq31-25'),
(506, 31, 137, 1, 'このもんだいのこたえは１です。＃前半＃', 1, 15, 0, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:38:15', '2019-06-29 13:46:49', 74, 'dq31-5'),
(507, 31, 137, 1, '＃はい、こたえは１です。＃そして全体からです。', 1, NULL, 3, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:38:47', '2019-06-29 13:46:49', 74, 'dq31-21'),
(508, 31, 137, 1, 'これはだいじなことです。＃こたえは１＃で中盤からです。', 1, 84, 1, 2, '2019-06-29 13:46:49', 0, '2019-06-29 13:39:27', '2019-06-29 13:46:49', 74, 'dq31-10'),
